pragma solidity>= 0.5.0 <0.9.0;

contract Loop
{
    uint[10] public arr;

    function for_loop_1_to_10() public
    {
        for(uint i = 0;i<arr.length;i++)
        {
            arr[i] = i;
        }
    }

    function while_loop_10_to_100() public
    {
        uint pos = 0;
        while(pos < arr.length)
        {
            arr[pos] = (pos+1)*10;
        }
    }
}

